import Searchbar from "../Searchbar";

const Headerbar = () => {
    return (
        <div className="header">
            <div className="logo">
                <img src='https://logos-world.net/wp-content/uploads/2022/04/OLX-Symbol.png'
                height={40} width={60} />
            </div>
            <Searchbar location/>
        </div>
    );
};
 
export default Headerbar;
